import Vue from 'vue'
import App from './App.vue'
import router from './router'
import './registerServiceWorker'
import 'bootstrap/dist/css/bootstrap.css'
// import "bootstrap-vue/dist/bootstrap-vue.css";
// import BootstrapVue from "bootstrap-vue";
import {
  FormRadio,
  Modal,
  Button,
  FormGroup
} from 'bootstrap-vue/es/components'

// Vue.use(BootstrapVue);
Vue.use(FormGroup)

Vue.use(Button)

Vue.use(FormRadio)

Vue.use(Modal)

Vue.config.productionTip = false

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
function cacheAssets (assets) {
  return new Promise(function (resolve, reject) {
    caches
      .open('assets')
      .then(cache => {
        cache
          .addAll(assets)
          .then(() => {
            console.log('all assets added to cache')
            resolve(0)
          })
          .catch(err => {
            console.log('error when syncing assets', err)
            reject(new Error(1))
          })
      })
      .catch(err => {
        console.log('error when opening cache', err)
        reject(new Error(2))
      })
  })
}
var assets = [
  '/assets/bells_ab.svg',
  '/assets/gmsm/I1.svg',
  '/assets/gmsm/I2.svg',
  '/assets/gmsm/I3.svg',
  '/assets/gmsm/I4.svg',
  '/assets/gmsm/I5.svg',
  '/assets/gmsm/I6.svg',
  '/assets/gmsm/IB.svg',
  '/assets/gmsm/II1.svg',
  '/assets/gmsm/II2.svg',
  '/assets/gmsm/II3.svg',
  '/assets/gmsm/II4.svg',
  '/assets/gmsm/II5.svg',
  '/assets/gmsm/II6.svg',
  '/assets/gmsm/IIB.svg',
  '/assets/gmsm/III1.svg',
  '/assets/gmsm/III2.svg',
  '/assets/gmsm/III3.svg',
  '/assets/gmsm/III4.svg',
  '/assets/gmsm/III5.svg',
  '/assets/gmsm/III6.svg',
  '/assets/gmsm/IIIB.svg',
  '/assets/gmsm/IV1.svg',
  '/assets/gmsm/IV2.svg',
  '/assets/gmsm/IV3.svg',
  '/assets/gmsm/IV4.svg',
  '/assets/gmsm/IV5.svg',
  '/assets/gmsm/IV6.svg',
  '/assets/gmsm/IVB.svg',
  '/assets/gmsm/VII.svg',
  '/assets/gmsm/VIII.svg'
]
cacheAssets(assets).then(() => {
  console.log('All assets cached')
})
